// import logo from './logo.svg';
// import './App.css';

function App() {
  return (
    <>
      <article>
        <h1>Personal Record</h1>
        <p>รายงานประวัติส่วนตัว</p>
        <ul>
          <li>ภาณุเดช แสงวิเศษ</li>
          <li>การาวิน ยินดี</li>
          <li>จีรายุ แสงอาวุธ</li>
        </ul>
      </article>

    </>

  );
}

export default App;
